import React from 'react';
import API from '../Api';//Cambiar a constantes
import axios from 'axios';
import {DataTable,Column} from 'primereact/datatable';
import {Button} from 'primereact/button';


class BienesApi extends React.Component {
    
    constructor() {
        super();
        this.state = { fiduca: {data:[]} };
        
    }

    llamada() {
        return axios.get('http://127.0.0.1:7101/FiduciaWeb/getRef.do?json={"id":"funRegistroGarantias"}')
               .then(res => res);
    }

    componentDidMount() {
        
        this.llamada().then(data => {
            this.setState({fiduca: data});
        });
        
    }
    
    render() {

        let status = [
            {label: 'ACTIVO', value: 'Green'},
            {label: 'INACTIVO', value: 'Red'},
            {label: 'SUSPENDIDO', value: 'Orange'},
            {label: 'CANCELADO', value: 'Yellow'}
        ];

        return (
            <div className="datatable-doc-demo">
                <DataTable value={this.state.fiduca.data} paginator={true} rows={10} header={header} globalFilter={this.state.globalFilter}>
                    <Column field="vin" header="Fideicomiso" filter={true} />
                    <Column field="year" header="Garantia" filter={true} />
                    <Column field="brand" header="Importe Garantia" filter={true} />
                    <Column field="color" header="Status" filter={true}  />
                </DataTable>
            </div>
        );
    }
}
export default BienesApi;
